// Footer.js
// Footer.js
import React from 'react';
import { FaLinkedin, FaGithub } from 'react-icons/fa'; // Import the correct icons from react-icons

// ... rest of the code remains unchanged ...
// Import the LinkedIn and GitHub icons
import styled from 'styled-components';

const FooterContainer = styled.footer`
  background-color: #f0f0f0;
  padding: 20px 0;
`;

const SocialIconsContainer = styled.div`
  display: flex;
  justify-content: center;
  align-items: center;

  a {
    margin: 0 10px;
    color: #333;
    transition: color 0.2s;

    &:hover {
      color: #0077b5; /* Change the color on hover */
    }
  }
`;

function Footer() {
  return (
    <FooterContainer>
      <div className="footer-container">
        <SocialIconsContainer>
          {/* LinkedIn Icon */}
          <a
            href="https://www.linkedin.com/in/your-linkedin-profile-url"
            target="_blank"
            rel="noopener noreferrer"
          >
            <FaLinkedin size={24} />
          </a>
          {/* GitHub Icon */}
          <a
            href="https://github.com/your-github-username"
            target="_blank"
            rel="noopener noreferrer"
          >
            <FaGithub size={24} />
          </a>
        </SocialIconsContainer>
      </div>
    </FooterContainer>
  );
}

export default Footer;
